import React from 'react';
import ProcedureStep from '../../containers/ProcedureStep';
import styles from './index.module.css';

const ProcedureSteps = ({steps}) => steps && steps.length ? (
  <div className={styles.list}>
    {steps.map(step => <ProcedureStep key={step.id} step={step} />)}
  </div>
) : (
  <div className={styles.empty}>
    This procedure currently has no steps
  </div>
)

export default ProcedureSteps;
